import react, { Component } from "react";
import {
  Table,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  Alert,
} from "reactstrap";

class ListBancoDeHoras extends Component {
  render() {
    return (
      <div>
        <h1>Listar Banco de Horas</h1>
        <h2>Aqui Estara A Lista o Banco de Horas</h2>
      </div>
    );
  }
}

class FormBancoDeHoras extends Component {
  render() {
      return(
    <div>
      <h1>Formulario Banco de Horas</h1>
      <h2>Aqui o Formulario o Banco de Horas</h2>
    </div>
    );
  }
}

class Dashboard extends Component {
  render() {
    return (
      <div>
        <div className="">
          <div className=" ">
            <FormBancoDeHoras />
            <div>
                <div>
                    <ListBancoDeHoras/>
                </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard;
